import React from "react";

export const BarChartLabel = data => {
  const i = data.index;
  const  valueDay  = data.data.map(e=>e.day);
  const  valueNumber  = data.data.number;
  console.log(valueDay[i]);
  const x = data.x;
  const y = data.y;
  return (
    <svg>
      {
        <text x={x + 49} y={y+5}>
          {valueDay[i]}
        </text>
      }
      {
        <text x={x + 350} y={y - 10}>
          {valueNumber}
        </text>
      }
    </svg>
  );
};
